import React, { useEffect } from 'react';
import bcrypt from "bcryptjs";


const SorarePlayer = () => {
    var salt=""
    useEffect (() => {
        fetch("https://api.sorare.com/api/v1/users/clement.massee@gmail.com")
        .then(response=> {
            return response.json();
        })
        .then(users => {
            salt=users
            console.log(users.salt)
        })
    },[])
    console.log(salt)
    const hashedPassword = bcrypt.hashSync("ClementEric2811", salt);
    console.log(hashedPassword)
    return(
        <div>
            <h1>{hashedPassword}</h1>
        </div>
    );
}

export default SorarePlayer;
